import { useContext } from "react";
import Loglist from "../components/Loglist";
import { TollContext } from "../../shared/context/toll-context";

const Logs = ()  => {
    const toll=useContext(TollContext)
    return (
        
        <Loglist logs={toll.logs}></Loglist>
    )
}

export default Logs;
